const elements=[["link",{type:"text/css",rel:"stylesheet",href:"https://pyscript.net/alpha/pyscript.css"}],["script",{defer:"true",type:"text/javascript",src:"https://pyscript.net/alpha/pyscript.js"}]];for(let[b,c]of elements){let a=document.createElement(b);Object.entries(c).forEach(b=>a.setAttribute(...b)),document.body.appendChild(a)}document.addEventListener("DOMContentLoaded",()=>{const a=document.createElement("py-script");a.innerHTML=document.scripts[document.scripts.length-1].innerText.trim(),document.body.appendChild(a)})